import React from 'react'

/* Components */
import { FontAwesomeIcon, Button } from 'react-bee'

const App = () => {
  return (
    <>
      <p>Example</p>
      <br />
      <Button href='http://samline.com' label='lol' target='_blank' />
    </>
  )
}

export default App
